import React  from 'react';
import './App.css';
import { RouterProvider, createBrowserRouter } from 'react-router-dom';
import Layout from './Layouts/Layout';

function App() {

  const router = createBrowserRouter([
    {
      element: <Layout />
      
    }
  ])
  return (
    <div>
      {/*  
      <NavBar/> */}
      <RouterProvider router={router}/>
    </div>
  );
}

export default App;
